Projecting a single point is simple enough. Let's try something a little more interesting. Polygon around the Ivanhoe reservoir in Los Angeles People often say that the best way to learn is by making a mistake, so follow along as we do exactly that when calculating the area of this reservoir. Compute Area the Wrong Way use geo::Polygon;
use wkt::TryFromWkt;
use geo::algorithm::area::Area; let wkt_polygon = "POLYGON((-118.2662232 34.1038592,-118.2662339 34.1023485,-118.2639303 34.1023235,-118.2649125 34.1038878))";
let mut polygon: Polygon = Polygon::try_from_wkt_str(wkt_polygon).unwrap(); // ðŸ¤” That's a suspiciously small number for so much water.
assert_eq!(polygon.unsigned_area(), 0.000002779367475015937); Ivanhoe reservoir is large enough to hold over 400,000 shade balls , so any area measurement that begins with 0.00000... is highly suspect. Because our polygon was described in degrees (unprojected coordinates), the units of area we just computed are in "square degrees" which is not a very useful measurement. A degree near the North Pole is very different from a degree near the equator (and not just in terms of temperature). To get a reasonable result, we should first project the polygon to a euclidean coordinate reference system that is suitable for Los Angeles. Compute Area the Right Way # use geo::Polygon;
# use wkt::TryFromWkt;
# use geo::algorithm::area::Area;
#
# let wkt_polygon = "POLYGON((-118.2662232 34.1038592,-118.2662339 34.1023485,-118.2639303 34.1023235,-118.2649125 34.1038878))";
# let mut polygon: Polygon = Polygon::try_from_wkt_str(wkt_polygon).unwrap();
#
use proj::Transform;
// Transform from WGS84 to EPSG:6423
// https://epsg.io/6423 - California zone 5 (meters)
polygon.transform_crs_to_crs("WGS84", "EPSG:6423").unwrap(); // Now we can get a useful "square meters" measurement.
assert_eq!(polygon.unsigned_area().round(), 28447.0); Notice that we can transform this polygon the same way we previously transformed a single point. Now we know that approximately 28.4k square meters are required to hold 400k floating spheres in one small spot on the floating (slightly smooshed) sphere we call home, and we've solved a story problem that we were never even asked.

